// var APIData = d3.json('http://192.168.8.197:8000/ClimateDataPoints/?minutes=60', buildChart);
 
 
function buildChart() {
    var wrapped = [dummyLineData];

 
    //Prep the data
    let readingData = wrapped[0]["Readings"];
    let SettingsData = wrapped[0]["Settings"];

    console.log('readingData ->',readingData);
 
    readingData.map(function (d) {
        d.t = new Date(d.t);
    });
 
    SettingsData.map(function (d) {
        d.t = new Date(d.t);
    });
 
    //set margins for chart
    var margin = {
        top: 20,
        right: 10,
        bottom: 40,
        left: 100
    },
     width = 800,
     height = 380,
     heightLessMargins = height - margin.top - margin.bottom,
     widthLessMargins = width - margin.left - margin.right,
     xLabelText = "Time",
     tempLabelText = "Temperature",
     humidityLabelText = "Humidity",
     vars = {
         tempColor: "green",
         humidityColor: "steelblue",
         heaterColor: "rgba(204,51,153,.6)"
     },
     topHalfRange = [(heightLessMargins / 2), margin.top],
     bottomHalfRange = [heightLessMargins, (heightLessMargins / 2)];
 
    //Select html elements & incorporate into D3
    var vis = d3.select(".CopysvgWrapper");
    var gWrapper = d3.select(".CopygWrapper");
    var tempAxisG = d3.select(".CopytempAxisG");
    var humidityAxisG = d3.select(".CopyhumidityAxisG");
    var xAxisG = d3.select(".CopyaxisGx");
    var xAxisLabel = d3.select(".Copybottom");
    var tempAxisLabel = d3.select(".CopytemperatureLabel");
    var humidityAxisLabel = d3.select(".CopyhumidityLabel");
 
    //set svg & g wrapper styles
    vis.attr("transform", 'translate(0,' + margin.top + ')');
    gWrapper.attr('transform', 'translate(0,' + heightLessMargins + ')');
 
    // set the scales & ranges
    var xScale = d3.scaleUtc().range([margin.left, ( width - margin.right)]);
    var yTempScale = d3.scaleLinear().range(topHalfRange);
    var humidityYScale = d3.scaleLinear().range(bottomHalfRange).nice();
 
    //attrubites for x & y labels
    xAxisLabel
        .attrs({
            "x": (widthLessMargins / 2),
            "y": 80
        })
    .text(xLabelText);
 
    tempAxisLabel
        .attrs({
            "class": "axis-label left",
            "x": -(heightLessMargins /3.5),
            "y": -margin.left + 35,
            'transform': 'rotate(-90)',
            'text-anchor': 'middle',
            "stroke": vars.tempColor
          })
        .text(tempLabelText);
 
    humidityAxisLabel
        .attrs({
            "class": "axis-label humidityLabel",
            "x": -(heightLessMargins - margin.bottom - 15),
            "y": -margin.left + 35,
            'transform': 'rotate(-90)',
            'text-anchor': 'middle',
            "stroke": vars.humidityColor
        })
    .text(humidityLabelText+" %");
 
    //set axis objects
    var xAxisObj = d3.axisBottom()
        .scale(xScale)
        .tickPadding(15)
        .tickSize(-heightLessMargins + 50)
        .tickFormat(d3.timeFormat("%-I:%M"));
 
    var tempAxisObj = d3.axisLeft()
        .scale(yTempScale)
        .ticks(2)
        .tickPadding(10)
        .tickSize(-(widthLessMargins));
 
    var HumidityYAxisObj = d3.axisLeft()
        .scale(humidityYScale)
        .ticks(3)
        .tickSize(-(widthLessMargins))
        .tickPadding(10)
        .tickFormat(function(d) { return d});
 
    // define the  blue humidity line
    var valueline = d3.line()
        .x(function (d) { return xScale(d.t); })
        .y(function (d) { return yTempScale(d.it); });
 
    //define the red temperature line
    var value2line = d3.line()
            .x(function (d) { return xScale(d.t); })
            .y(function (d) { return humidityYScale(d.ih); });
 
    //define the heater-on area indicator
    var area = d3.area()
        .x(function(d) { return xScale(d.t); })
        .y0(heightLessMargins)
        .y1(function (d) {
            return d.ho == 1
            ? 0
        : heightLessMargins
        });
 
    // Scale the domain of the scales
    xScale.domain(d3.extent(readingData, function (d) { return d.t; }));
    yTempScale.domain([(d3.min(readingData, function (d) { return d.it; }) * .99), d3.max(readingData, function (d) { return d.it; })]);
    humidityYScale.domain([ (d3.min(readingData, function (d) { return d.ih; }) * .95), d3.max(readingData, function (d) { return d.ih; }) ]);
 
 
    // Add the area heater-on indicator
    var heaterOnArea = vis.append("path")
        .data([readingData])
        .attrs({
            "class": "heater-on-area",
            "d": area,
            "fill": vars.heaterColor
        })
 
    // Add the temperature path.
    var temperatureLine = vis.append("path")
        .data([readingData])
        .attrs({
            "class": "temperatureline",
            "d": valueline,
            "stroke": vars.tempColor
        });
 
 
    // Add the humidity path.
    var humidityLine = vis.append("path")
        .data([readingData])
        .attrs({
            "class": "humidityline",
            "d": value2line,
            "stroke": vars.humidityColor
        });
 
    //connect the X & Y axis to the axis G wrappers
    xAxisG.call(xAxisObj)
        .selectAll('.tick line').attrs({
            "class" : "xLine",
            "stroke-dasharray" : '1,10'
        })
 
    //Update xAxis Label Styling
    xAxisG.selectAll('.tick text')
        .attrs({
            'transform': 'rotate(-45)',
            'text-anchor': 'end',
            'alignment-baseline': 'middle',
            'x': -5,
            'y': 15,
            'dy': 0,
            'class':'xAxisTickText'
        });
 
    //Connect yAxis Objects to yAxis Group element
    tempAxisG
        .attrs({
            'transform': 'translate('+margin.left+',-' + ( heightLessMargins ) +')'
        })
        .call(tempAxisObj)
        .selectAll('.tick line').attrs({
            "class": "yLine",
            "stroke-dasharray": '1,10'
        });
    //Update color of left yAxis tick color
    tempAxisG.selectAll('.tick text').attr('fill', vars.tempColor);
 
    //shrink the font-size on the x-axis
    xAxisG.selectAll('.tick text').attr('font-size', '18px');
 
    //update style of right y axis G
    humidityAxisG
        .attrs({
            'transform': 'translate(' + margin.left + ',-' + (heightLessMargins) + ')'
        })
        .call(HumidityYAxisObj)
        .selectAll('.tick line').attrs({
            "class": "yLine",
            "stroke-dasharray": '1,10'
        });
 
    //Update color of right yAxis tick color
    humidityAxisG.selectAll('.tick text').attr('fill', vars.humidityColor);
 
}


buildChart();